import logo from './logo.svg';
import './App.css';
import Index from './components/Index'

function App() {
  return (
    <>
    <h1 className>SENA</h1>
    <div className="App">
      <Index />
    </div>
    <div className="contenedor-btns">
      <button className="btn-contador">disminuir</button>
      <button className="btn-contador">reset</button>
      <button className="btn-contador">aumentar</button>
    </div>
    </>
  );
}

export default App;
